import React from 'react';
import {
  Button, Drawer,
  withStyles
} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

const MobileBar = ({ classes }) => {

  return (
    <div>
      <MenuIcon />
      <div style={{color: '#f50057', fontSize: 20, fontWeight: 'bold'}}>
          MovieDB App
      </div>
      <Drawer
        // className={classes.drawer}
        variant="persistent"
        anchor="left"
        // open
        classes={{
          paper: classes.drawerPaper
        }}
      >

      </Drawer>
    </div>
  );
}

const styles = () => ({
  drawerPaper: {
    width: 200,
    backgroundColor: 'grey'
  }
});

export default withStyles(styles)(MobileBar);
